202. Happy Number
← Back to problem
Approach 1: Detect Cycles with a HashSet
A good way to get started with a question like this is to make a couple of examples. Let’s start with the number 777. The next number will be 494949 (as 72=497^2 = 497​2​​=49) and then the next after that will be 97 (as 42+92=974^2 + 9^2 = 974​2​​+9​2​​=97). We can continually repeat the process of squaring and then adding the digits until we get to 111. Because we got to 111, we know that 777 is a happy number, and the function should return true.

As another example, let’s start with 116116116. By repeatedly applying the squaring and adding process, we eventually get to 585858, and then a bit after that, we get back to 585858. Because we are back at a number we’ve already seen, we know there is a cycle, and therefore it is impossible to ever reach 111. So for 116, the function should return false.

Based on our exploration so far, we’d expect continually following links to end in one of three ways.

It eventually gets to 111.
It eventually gets stuck in a cycle.
It keeps going higher and higher, up towards infinity.

That 3rd option sounds really annoying to detect and handle. How would we even know that it is going to continue going up, rather than eventually going back down, possibly to 1?1? Luckily, it turns out we don’t need to worry about it. Think carefully about what the largest next number we could get for each number of digits is.



