            number, digit = divmod(number, 10)
            total_sum += digit ** 2
        return total_sum

    slow_runner = n
    fast_runner = get_next(n)
    while fast_runner != 1 and slow_runner != fast_runner:
        slow_runner = get_next(slow_runner)
        fast_runner = get_next(get_next(fast_runner))
    return fast_runner == 1






Complexity Analysis

Time complexity: O(logn){O}(\log n)O(logn). Builds on the analysis for the previous approach, except this time we need to analyse how much extra work is done by keeping track of two places instead of one, and how many times they'll need to go around the cycle before meeting.

If there is no cycle, then the fast runner will get to 1, and the slow runner will get halfway to 1. Because there were 2 runners instead of 1, we know that at worst, the cost was O(2⋅logn)=O(logn)O(2 \cdot \log n) = O(\log n)O(2⋅logn)=O(logn).
Once both pointers are in the cycle, the fast runner will get one step closer to the slow runner at each cycle. Once the fast runner is one step behind the slow runner, they'll meet on the next step. Imagine there are kkk numbers in the cycle. If they started at k−1k - 1k−1 places apart (which is the furthest apart they can start), then it will take k−1 k-1 k−1 steps for the fast runner to reach the slow runner, which again is constant for our purposes. Therefore, the dominating operation is still calculating the next value for the starting nnn, which is O(logn)O(\log n)O(logn).


Space complexity: O(1){O}(1)O(1), space required for fast and slow pointers are always the same.

